import React from "react";

export default function ImagesGrid(props) {
  if (props.images) {
    return (
      <div className='imagesGrid'>
        {props.images.map(function (image, index) {
          return (
            <img
              src={image.src.tiny}
              alt='related to the search'
              className='p-1'
              key={index}
            />
          );
        })}
      </div>
    );
  } else {
    return null;
  }
}
